import React from 'react'; 
import { connect } from 'react-redux';
import { openEditForm } from '../../../actions/dashboard';

const RecipeListItem = ({ recipeTitle, recipeId, openEditForm }) => {

    return (
        <li>
            <a href="#!">{recipeTitle}</a>
            <button className="btn-grey">Edit</button>
        </li>
    )
}


export default connect(null, { openEditForm })(RecipeListItem);
